import React from "react";
import RatingQuestion from "../RatingQuestion";

const Sensing_vs_Intuition = () => {
  const questions = [
    " I like to live in the present moment",
    " I like to ponder the future",
    "I tend to be forgetful of the past",
    "I am oriented towards the past",
    "Thinking about the future makes me excited",
    "I look past things when I’m perceiving the world around me",
    "I see the concrete physical facts when I’m perceiving the world around me",
    "I think a lot about the meaning of things",
    "I appreciate the reality of things",
    "I prefer to ponder the meaning behind Abstract Artwork",
    "I prefer to enjoy the beauty of  Artwork",
    "I think about the why behind things - why something happened or why something is.",
    "I think about the what’s going on - what happened and what something is.",
    "I pay attention to sensory facts about other people",
    "I pay attention to intuitive patterns about other people",
  ];

  const values = [];

  const getValue = (name, value) => {
    values.push({ question_number: name, value: value });
  };

  return (
    <div className="page">
      <article>
        <h1> Sensing vs Intuition </h1>
        <h4>
          Answer the following questions truthfully, honestly, and thoughtfully.
        </h4>
        {questions.map((e, i) => (
          <RatingQuestion
            getValue={getValue}
            id={i}
            name={"s" + i}
            question={e}
          />
        ))}
        <h4>Let's see what you've got!</h4>
        <button>Bing Bong</button>
      </article>
    </div>
  );
};

export default Sensing_vs_Intuition;
